import collections


ArrayItem = collections.namedtuple('ArrayItem', ['value', 'snapid'])


class SnapshotArray:

    def __init__(self, length: int):
        self.array = [ArrayItem(0, -1) for _ in range(length)]
        self.snaps = [[] for _ in self.array]
        self.dirty = set()
        self.currsnap = 0

    def set(self, index: int, val: int) -> None:
        item = self.array[index]
        new_item = ArrayItem(val, self.currsnap)
        self.array[index] = new_item
        self.dirty.add(index)

    def snap(self) -> int:
        """
        int snap() takes a snapshot of the array and returns the snap_id: the total number of times we called snap() minus 1.
        """
        for i in self.dirty:
            self.snaps[i].append(self.array[i])
        self.currsnap += 1
        self.dirty.clear()
        return self.currsnap - 1

    def get(self, index: int, snap_id: int) -> int:
        search_space = self.snaps[index]
        # Find the maximum snapshot less than or equal to the desired
        # snapshot.  This will be the value at the desired snapshot.
        i = -1
        lo = 0
        hi = len(search_space) - 1
        while lo <= hi:
            mid = lo + ((hi - lo) // 2)
            if search_space[mid].snapid <= snap_id:
                i = max(i, mid)
                lo = mid + 1
            else:
                hi = mid - 1
        if i == -1:
            return 0
        return search_space[i].value


